import React from "react";
import ToDo from "./components/todo/todo.js";
import Navbar from ''


function App() {
  return (
    <>
      <Navbar bg="primary" variant="dark">
        <Navbar.Brand href="#home"></Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link href="#home">Home</Nav.Link>
        </Nav>
      </Navbar>
      <ToDo />
    </>
  );
}

export default App;
